import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [data, setData] = useState(null);
  const [error, setError] = useState(null);
  const [pickupAddress, setPickupAddress] = useState('');
  const [dropoffAddress, setDropoffAddress] = useState('');
  const [ws, setWs] = useState(null);

  useEffect(() => {
    // Create WebSocket connection
    const websocket = new WebSocket('ws://localhost:8002/ws/prices');

    websocket.onopen = () => {
      console.log('WebSocket connected');
      // Send initial message with pickup and dropoff addresses
      websocket.send(JSON.stringify({
        pickup: pickupAddress,
        dropoff: dropoffAddress,
      }));
    };

    websocket.onmessage = (event) => {
      console.log('Received WebSocket message:', event.data);
      try {
        const result = JSON.parse(event.data);
        setData(result);
        setError(null);
      } catch (e) {
        console.error('Error parsing WebSocket message:', e);
        setError('Error parsing price data');
      }
    };

    websocket.onerror = (error) => {
      console.error('WebSocket error:', error);
      setError('WebSocket connection failed');
    };

    websocket.onclose = () => {
      console.log('WebSocket disconnected');
      setError('WebSocket connection closed');
    };

    setWs(websocket);

    // Cleanup on unmount
    return () => {
      websocket.close();
    };
  }, []); // Run once on mount

  // Reconnect WebSocket when addresses change
  useEffect(() => {
    if (ws) {
      ws.send(JSON.stringify({
        pickup: pickupAddress,
        dropoff: dropoffAddress,
      }));
    }
  }, [pickupAddress, dropoffAddress, ws]);

  if (error) return <div>Error: {error}</div>;
  if (!data) return <div>Loading...</div>;

  return (
    <div className="App">
      <h1>Cost Catcher - Price Comparison</h1>
      <div className="address-inputs">
        <h3>Enter Your Addresses</h3>
        <div>
          <label>Pickup Address: </label>
          <input
            type="text"
            value={pickupAddress}
            onChange={(e) => setPickupAddress(e.target.value)}
            placeholder="e.g., 123 Main St, City"
          />
        </div>
        <div>
          <label>Drop-off Address: </label>
          <input
            type="text"
            value={dropoffAddress}
            onChange={(e) => setDropoffAddress(e.target.value)}
            placeholder="e.g., 456 Oak St, City"
          />
        </div>
      </div>
      <div className="category">
        <h2>Rides</h2>
        <div>
          {data.results
            .filter(r => r.category === 'ride')
            .map(r => (
              <div key={r.provider} className="provider">
                {r.provider}: ${r.price.toFixed(2)}
              </div>
            ))}
        </div>
        <div className="cheapest">
          {data.cheapest.ride ? (
            `Cheapest: ${data.cheapest.ride.provider} at $${data.cheapest.ride.price.toFixed(2)}`
          ) : (
            'No ride prices available'
          )}
        </div>
        <div className="savings">
          {data.savings.ride > 0
            ? `You save $${data.savings.ride.toFixed(2)} by choosing the cheapest!`
            : 'No savings available'}
        </div>
      </div>
      <div className="category">
        <h2>Groceries</h2>
        <div>
          {data.results
            .filter(r => r.category === 'grocery')
            .map(r => (
              <div key={r.provider} className="provider">
                {r.provider}: ${r.price.toFixed(2)}
              </div>
            ))}
        </div>
        <div className="cheapest">
          {data.cheapest.grocery ? (
            `Cheapest: ${data.cheapest.grocery.provider} at $${data.cheapest.grocery.price.toFixed(2)}`
          ) : (
            'No grocery prices available'
          )}
        </div>
        <div className="savings">
          {data.savings.grocery > 0
            ? `You save $${data.savings.grocery.toFixed(2)} by choosing the cheapest!`
            : 'No savings available'}
        </div>
      </div>
    </div>
  );
}

export default App;
